export default function PopUpLogs( { Turn, setTurn } ) {
    function handleClick(e) {
        e.preventDefault();
        setTurn(!popUpTurnOnOff);
    }
    return (
        <div className={Turn ? "flex" : "hidden"}>
        <h1 onClick={handleClick}>text</h1>
        </div>
    )
}
